From &lt;a href="http://www.simpsoncity.com/hiking/" rel="nofollow"&gt;Dan's Hiking Pages&lt;/a&gt; :&lt;br /&gt;
&lt;br /&gt;
In the heart of Big Santa Anita Canyon, beautiful Sturtevant Falls with its 50 feet of cascading water attracts thousands of visitors a year. The thick chaparral and lush riparian scenery offers a delightful saunter. Along the creek-side trail you are soothed by the sights and sounds of sparkling water playfully dancing and splashing under a canopy of alder, oak, bay, spruce, and willow. Ivy and vinca with its periwinkle flowers planted by early pioneers blanket large areas.  &lt;a href="http://www.simpsoncity.com/hiking/sturtevant.html" rel="nofollow"&gt;More.&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/greggoodman/"&gt;Greg - AdventuresofaGoodMan.com&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/greggoodman/4773214985/" title="Route 66 Emblems on the Rainbow Bridge over Bush Creek, Riverton, Kansas"&gt;&lt;img src="http://farm5.static.flickr.com/4095/4773214985_e9a7ed8860_m.jpg" width="240" height="198" alt="Route 66 Emblems on the Rainbow Bridge over Bush Creek, Riverton, Kansas" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The segment of Route 66 through Kansas and later Oklahoma were two of the main reasons I finished driving the Mother Road. During a cross country adventure from New York City to San Francisco, I originally was ending my Route 66 journey in Missouri and then taking the Oregon Trail the rest of the way across the country, but was convinced to at least do the 7 (or maybe 9) mile stretch of 66 in Kansas and check out one town in OK. Well I did that and the extra time helped me to decide to keep going to the end. Best. Decision. Ever.&lt;br /&gt;
&lt;br /&gt;
- - - - - - - - - - - - - -  - - - - - - -  - - - - - - - - - - - - -  - - - - -  - - - - -&lt;br /&gt;
Some useful information from &lt;a href="http://en.wikipedia.org/wiki/Rainbow_Bridge_(Kansas)" rel="nofollow"&gt;good 'ole Wikipedia&lt;/a&gt;:&lt;br /&gt;
&lt;br /&gt;
The Rainbow Bridge is an old bridge over Brush Creek approximately two miles west of Riverton, Kansas on former U.S. Route 66, now a county road. The bridge is a single-span concrete Marsh arch bridge and is the sole surviving bridge of this type on the entire length of the former highway. Two other Marsh arch bridges were also located on US 66 in Kansas, both over the Spring River. It was built in 1923.&lt;br /&gt;
&lt;br /&gt;
The bridge has often been covered with graffiti, but was recently re-painted white. The bridge has been placed on the National Register of Historic Places (as the Brush Creek Bridge) on March 10, 1983, due to its connection with Route 66 and is also a Kansas state landmark.&lt;br /&gt;
&lt;br /&gt;
The bridge is fairly narrow, and due to traffic on the road, a replacement bridge has been built. The road curves toward the new bridge toward Baxter Springs, but a short, one-way road carries traffic to the Rainbow Bridge, which may still be crossed. This was part of a compromise after a disagreement between the county and the Kansas Route 66 Association as federal funds used for construction of the new bridge required demolition of the old. The bridge had been listed with the National Register, which prohibited condemnation of the old bridge.&lt;br /&gt;
&lt;br /&gt;
