&lt;p&gt;One of the first places I shot in Edinburgh, this place looks a bit different now with the fast approaching evening light and colorful leaves all over the turf. The golden light was too great to resist - it really helped accentuate the color on (and off) the trees. Facing southeast, the tip of The Balmoral can be seen just peeking out near the left base of the monument.&lt;br /&gt;
&lt;br /&gt;
